const Home = props => {
  return (
    <Layout>
      <div className="home d-flex justify-center">
        <img className="canvas" src="/images/canvas.jpg" alt="canvas" />
        <img className="paint" src="/images/paint.jpg" alt="paint" />
      </div>
      {/* <h1>Hello world</h1> */}
      <style jsx>
        {`
          .home {
            background-image: url("/images/blank-canvas.jpg");
            background-size: cover;
            background-position: center;
            height: 100vh;
            width: 100vw;
             {
            }
          }
          .canvas {
            width: 350px;
            height: 341px;
            margin-top: 15%;
          }
          .paint {
            width: 322px;
            margin-top: 15.9%;
